# Loads pretrained model
model = gensim.models.KeyedVectors.load_word2vec_format(
    'GoogleNews-vectors-negative300.bin.gz', binary=True)

# Makes vector from string
def get_vec(s):
  words = s.split()
  vec = np.zeros(300)
  n = 0
  for word in words:
    # Checks if word is a common word
    try:
      a = common_words[word]
      # if common word, continue
      continue
    except KeyError:
      a = 1 + 1
    # Checks if word can be converted into vector
    try:
      # If so, add vector to vec and increment n
      vec += model[word]
      n += 1
    except KeyError:
      continue
  # If n is 0, just return vec
  if n == 0:
    return vec
  # Else, divide vec by n
  return vec/n

# Gets how similar two vectors are
# Uses the equation (A*B)/(||A||*||B||)
# Has epsilon in case one of the magnitudes is 0
def similar_vec(vec1, vec2, epsilon=0.0000000000001):
  return np.dot(vec1, vec2)/(np.linalg.norm(vec1)*np.linalg.norm(vec2) + epsilon)

def similar(s1, s2):
  # Gets vector for s2
  vec = get_vec(s2)
  sim = 0.0
  n = 0.0
  # Loops over words in s1
  for word in s1.split():
    # Continues if word is a common word
    try:
      a = common_words[word]
      continue
    except KeyError:
      a = 1 + 1
    # Checks if word can be converted into a vector
    try:
      # If so, similarity to sim and increment n by 1
      sim += similar_vec(model[word], vec)
      n += 1
    except KeyError:
      continue
  try:
    # If n isn't 0, return average sim (sim/n)
    return sim/n
  except ZeroDivisionError:
    # Else, return sim
    return sim

# Gets folder that the assignment is most similar to
def sort(a, folders):
    # Preproccess assignment so that program can better read it
    assignment = a.replace(':', ' ').replace('_', ' ').replace('-', ' ').replace('!', ' ').replace('?', ' ').replace('.', ' ').replace('/', ' ').replace('(', ' ').replace(')', ' ').replace('\\', ' ').replace('+', ' ').replace('@', ' ').replace('[', ' ').replace(']', ' ').replace('{', ' ').replace('}', ' ').replace('|', ' ').replace(':', ' ').replace(';', ' ')
    return max(folders, key=lambda folder: similar(assignment, folder))
